(def colors (into {} (map vector (distinct (map last data)) ["red" "green" "blue"])))

(defn visualize
  [data merges]
  (->> (viz/graph->image (range (count data))
                         (reduce (fn [g [i j]]
                                   (if (contains? g i)
                                     (update g i #(conj % j))
                                     (assoc g i [j])))
                                 {}
                                 merges)
                         :directed? false
                         :vertical? false
                         :options {"dpi" 50}
                         :node->descriptor (fn [i] {:label i :style "filled" :fillcolor (get colors (last (nth data i)))}))
       (image/image-view)))
